import "./Navbar.scss";

const Navbar = () => {
  const user = false;
  return (
    <div className="navbar">
      <div className="left">
        <span>MERN-AUTH</span>
      </div>

      <div className="middle">
        <div className="menubar">
          <div className="menuitem">
            <span>Home</span>
            <span>About</span>
            <span>Contact</span>
            <span>Blogs</span>
          </div>
        </div>
      </div>

      <div className="right">
        {user ? (
          <div className="user">
            <img src="Assets/avatar.png" alt="Profile Pic" />
            <span>Logout</span>
          </div>
        ) : (
          <div className="auth">
            <span>Login</span>
            <span>Register</span>
          </div>
        )}
      </div>

    </div>
  );
};

export default Navbar;
